        return(
            <div>
                <textContext.Provider value='this is a text!'>
                    <Second />
                </textContext.Provider>
            </div>
        )
    }

    const Second = () => {
        return (
            <>
                <Third />
            </>
        )
    }

    const Third = () => {
        return (
            <div>
                <textContext.Consumer>
                    /*
                    {(text) => {
                        return <div>{text}</div>;
                    }}
                    */
                </textContext.Consumer>
            </div>
        );
    };

    return (
        <>
            <Article/>
            <header className="header">
                <div>About Coffee</div>
            </header>
        </>
    );
}
